                            \State $\mu^{z} \leftarrow \lambda  \mu^{z} +  (1-\lambda)\frac{1}{K}\sum_{k=1}^K\displaystyle \frac{p(z\mid y^{(k)})}{p^z}y^{(k)}$
                        \EndFor
                    \EndFor
