\For{ $w\in (S\cap P)\cup T$} {
  \lIf{ $w \in S\cap P$ $\mathrm{and}$ $w\in T$ }{res$[w] = [U_{w}; V_{w}]$}
  \lElseIf{ $w\in S\cap P$ $\mathrm{and}$ $ w\notin T$ }{ res$[w] = [U_{w}; \vec{0}]$}
  \lElse{res$[w] = [\vec{0}; V_{w}]$}
}
\textbf{Return} res
