                Delete edge $O_r * \!\! - \!\! * O_j$ in $\widehat{\mathbb{G}}$
            }

        }
    }
     Remove $\langle O_i, O_j, O_k \rangle$ from $\mathcal{M}$
     }  \label{rfci_vs_end}
    \ForAll{elements $\langle O_i, O_j, O_k \rangle$ of $\mathcal{L}$}{ 
