\col{ 
	\Input{$(z^1,{\bf w}^1)\in \boldsymbol{\mathcal{H}}$, $(x_i^0,y_i^0)\in\mathcal{H}_i^2$ for $i=1,\ldots,n$.}
	\Parameters{$\{I_k\}_{k\in\nN}$ where $I_k\subseteq\{1,\ldots,n\}$, $0<\underline{\beta}\leq\overline{\beta}<2$, $\gamma>0$.}

	\For{$k=1,2,\ldots$}
