				\If{$i\in\Iback$}
				{
					$a = G_i z^{k}+\rho_{i}^{k} w_i^{k}+e_i^k$\label{lineaupdate2}
					\tcc*{do a backward step}
					$x_i^k = \prox_{\rho_{i}^{k} T_i}(a)
					$\label{LinebackwardUpdate2}\;
					$
					y_i^k = (\rho_{i}^{k})^{-1}
					\left(
					a - x_i^k
					\right)
					$\label{lineBackwardUpdateY2}\;


				}
				\Else
				{\label{LineForwardUpdate2}
